import React, { Fragment } from "react";

const Home = ({ handleName }) => {
  return (
    <Fragment>
      <form>
        <input
          name="name"
          type="text"
          placeholder="Enter your name"
          onChange={handleName}
        />
        <button type="submit">Submit</button>
      </form>
    </Fragment>
  );
};

export default Home;
